import React from "react";
import styles from "./button.module.css";

const button = ({ style, clicked, btnType }) => {
  const btnStyle = {
    btn: {
      backgroundColor: "transparent",
      border: "none",
      borderRadius: "100px",
      color: "#fff",
      padding: "0.4rem 1rem",
      marginLeft: "0.7rem",
      cursor: "pointer",
      font: "inherit",
      outline: "none",
      fontWeight: "bold",
    },
  };
  return (
    <button onClick={clicked} style={{ ...btnStyle.btn, style }}>
      {props.children}
    </button>
  );
};
export default button;
